 componentDidMount() {
   fetch('https://jsonplaceholder.typicode.com/comments')
     .then(response => response.json())
     .then(data => this.setState({ data }));
 } 

 clickhear =() =>{
    this.setState({name :' waldo'})
 };

 render(){
  return <div>
            <button onClick={this.clickhear}>Click me</button>
            <h1>hola {this.state.map(home => <div>{home.title}</div>)} </h1> 
        </div>
 }
}

